import React from "react";
import "./welcome-message.scss";
import WeShopButton from "./../../components/we-shop-button/we-shop-button";
function WelcomeMessage(props) {
  console.log(props.isConnectet);
  const welcomeUser = "Welcome" + props.isConnectet ? props.name : "Visitor";
  return (
    <div className="welcome-message">
      <span>{welcomeUser}</span>
      {!props.isConnectet && (
        <WeShopButton
          text="Register"
          onClick={x => props.onClick("Register")}
        ></WeShopButton>
      )}
    </div>
  );
}

export default WelcomeMessage;
